import React, {useState} from 'react';

import GetVehicleType from './GetVehicleType';
import SearchManufacturer from './SearchManufacturer';
import SearchModel from './SearchModel';
import SearchModelYear from './SearchModelYear';

function VehicleSearchPanel(props) {

    const [searchAgain, setsearchAgain] = useState(false);

    const [vehicleType, setVehicleType] = useState(null);
    const [manufacturer, setManufacturer] = useState(null);

    //TEMPORARY

    console.log("Manufacturer: ", manufacturer)

    return (

        <div>
            <GetVehicleType searchAgain={searchAgain} setVehicleType={setVehicleType}/>
            {vehicleType && <SearchManufacturer vehicleType={vehicleType} setManufacturer={setManufacturer}/>}
            <div onClick={setsearchAgain}>
                Reload
            </div>
        </div>
    )

}

export default VehicleSearchPanel;
